import styles from "./ToggleButton.scss";

let style = {
    backgroundColor: "#D1B5DB"
}

const ToggleButton = ({title}) => {

    return (
        <button className={styles.toggleButton} style={style} onClick={style.backgroundColor = "#36BAAA"}>{title}</button>
    )
}

export default ToggleButton;
